function toggleCounty(county) {
    // To do: This function could be eliminated if clicking map sent event directly to checkbox.
    var input = $('#Box-' + county.replace(" ", "_"));
    var geomCounty = geom[county];
    if (input.is(':checked')) {
        input.removeAttr('checked');
        // Immediately clear, so user does not need to roll off.
        geomCounty.animate({
            fill: "#fffafa", 
            stroke: "#99a"
        }, 100); // 10th of second.
    } else {
        input.attr('checked', 'checked');
    // Below instead sine 1 in 20 stayed color
    }
    // Reset county array with newly checked box
    selectedCounties = [];
    selectedCountiesNames = [];
    $('#countyList input.countySet').each(function (i, c) {
        if (c.checked) {
            selectedCounties.push(c.value);
            selectedCountiesNames.push($(c).parent()[0].id.substr(4));
            // Because check above does not always take effect
            // But ALMOST worked when reducing animation from 500 to 200.
            var geomCounty = geom[$(c).parent()[0].id.substr(4)];
            geomCounty.attr('fill', '#335533');
            geomCounty.attr('stroke', "#99a");
        }
    });
    updateCountyStr();
}
function unselectCounties() {
    selectedCounties = [];
    selectedCountiesNames = [];
    $('.countySet').removeAttr('checked');
    $('.regionSet').removeAttr('checked');
    $('#countyStr').html('');
    $('#countyStr').hide();

    var geomC = {};
    for (c in geom) {
        geomC = geom[c];
        // BUGBUG - Added back first part of if.  Not sure if needed.
        geomC.attr('fill', '#fffafa');
        geomC.attr('stroke', '#99a');
    }
}
function updateCountyStr() { // Called from georgia.js
    var countiesStr = '';
    $(countyData).each(function (i, county) {
        var found = ~$.inArray(county.countyid, selectedCounties);
        if (found) {
            countiesStr += ', ' + county.county;
        }
    });
    displayCountyStr(countiesStr);
}
function displayCountyStr(countiesStr) {
    if (countiesStr.length > 0) {
        countiesStr = "<b>Selected Counties:</b> " + countiesStr.substring(1, countiesStr.length);
        ;
        countiesStr += " - <a href='javascript:unselectCounties();' style='text-decoration:underline'>Unselect</a> <span id='modifyCounties'>/ <a href='javascript:goCounties();' style='text-decoration:underline'>Modify</a></span>";
        $('#countyStr').html(countiesStr);
        $('#countyStr').show();
    } else {
        $('#countyStr').show();
    }
}
// COUNTIES
function sortCounties(a, b) {
    return a.county > b.county ? 1 : -1;
}
function countyFacts(countyName) { // Called from georgia.js
    $(countyData).each(function (i, county) {
        if (county.county.toLowerCase() == countyName) {
            location.href = '/counties?countyid=' + county.countyid;
        }
    });
}
function goCountiesLocTab() {
    $('#countiesBox').show();
    $('#countyInfoBox').show();
    $('#countiesCanvas').show();
    $('#countyStr').show();
    $('#welcomeBox').hide();
}
function LoadCounties(jsonLinkCounties,checkedCountyIDs,currentTab) {
    jqxhrCounties = $.getJSON(jsonLinkCounties, function (data) {
        $.each(data.regions, function (i, region) {
            // Getting here!
            $.each(region.counties, function (i, county) {
                countyData.push(county);
            });
            regionData.push(region);
        });

        // Then sort countyData alphabetically.
        countyData.sort(sortCounties);

        var parent = document.getElementById('countyList');
			
        parent.innerHTML = '';

        var thumbCount = 0;
        var thumbMax = 8;
        staticLink = '';

        var child = document.createElement("div");
        child.innerHTML = '<div class="countyRow">Loading Counties...</div>';
        parent.appendChild(child);

        //$(document).ready(function () {
            // BUGBUG - Maybe this needs to be called until successful.
            setTimeout(function () {
                selectedCounties = [];
                selectedCountiesNames = [];
                $('#countyList input.countySet').each(function (i, c) {
                    if (c.checked) {
                        selectedCounties.push(c.value);
                        selectedCountiesNames.push($(c).parent()[0].id.substr(4));
                    }
                });
                var geomC = {};
                for (c in geom) {
                    geomC = geom[c];
                    if (~$.inArray(c, selectedCountiesNames)) {
                        geomC.attr('fill', '#335533');
                    } else {
                        geomC.attr('fill', '#fffafa');
                        geomC.attr('stroke', '#99a');
                    }
                }
            }, 500);


            $('.regionSet').live('click', function (e) {
                var next = $(this).parents('.listHeader').next('.countyWrapper');
                var inputs = next.find('input:checkbox');

                if (this.checked) {
                    inputs.attr('checked', 'checked');
                } else {
                    inputs.removeAttr('checked');
                }
            });

            $('#countyList input:checkbox').live('click', function (e) {

                if ($('#countyList input.regionSet').length > 0) { // if region checkboxes exist
                    selectedRegions = [];
                    $('#countyList input.regionSet').each(function (i, c) {
                        if (c.checked) {
                            selectedRegions.push(c.value);
                        }
                    });
                }
                selectedCounties = [];
                selectedCountiesNames = [];
                $('#countyList input.countySet').each(function (i, c) {
                    if (c.checked) {
                        selectedCounties.push(c.value);
                        selectedCountiesNames.push($(c).parent()[0].id.substr(4));
                    }
                });
                var geomC = {};
                for (c in geom) {
                    geomC = geom[c];
                    if (~$.inArray(c, selectedCountiesNames)) {
                        geomC.attr('fill', '#335533');
                        setTimeout(function () { // Called a second time since fade down can prevent first
                            }, 800);
                    } else {
                        geomC.attr('fill', '#fffafa');
                        geomC.attr('stroke', '#99a');
                    }
                }
                updateCountyStr();
            });


            $('.regionToggle').live('click', function (e) {
                if ($(this).text() == "hide") {
                    $(this).text("show");
                } else {
                    $(this).text("hide");
                }
                $(this).parents('.listHeader').next('.countyWrapper').slideToggle();
                e.preventDefault();
            });
            $('.regionRoll').live({
                mouseenter: function (e) {
                    if (istouch) return;
                    var regionid = this.id;

                    $(regionData).each(function (i, region) {
                        if (~$.inArray(region.regionid, selectedRegions)) {
                        }
                        var regionChecked = (~$.inArray(region.regionid, selectedRegions)) ? 'checked="checked"' : '';

                        if (region.regionid == regionid) {
                            $(region.counties).each(function (i, county) {
                                var geomCounty = geom[county.county.replace(" ", "_").toLowerCase()];
                                var countySelected = ~$.inArray(county.countyid, selectedCounties);
                                if (!countySelected) {
                                    geomCounty.animate({
                                        fill: "#999", 
                                        stroke: "#ccc"
                                    }, 100);
                                }
                            });
                        }
                    });
                },
                mouseleave: function (e) {
                    var regionid = this.id;

                    $(regionData).each(function (i, region) {
                        if (~$.inArray(region.regionid, selectedRegions)) {
                        }
                        var regionChecked = (~$.inArray(region.regionid, selectedRegions)) ? 'checked="checked"' : '';

                        if (region.regionid == regionid) {
                            $(region.counties).each(function (i, county) {
                                var geomCounty = geom[county.county.replace(" ", "_").toLowerCase()];
                                var countySelected = ~$.inArray(county.countyid, selectedCounties);
                                if (!countySelected) {
                                    geomCounty.animate({
                                        fill: "#fffafa", 
                                        stroke: "#99a"
                                    }, 100); // Any quicker causes regions to stay highlighted.
                                }
                            });
                        }
                    });
                }
            }
            );
            $('.countyRow').live({
                mouseenter: function (e) {
                    if (istouch) return;
                    var county = this.id.substr(4);
                    var geomCounty = geom[county];

                    if (geomCounty && ! ~$.inArray(county, selectedCountiesNames)) {
                        //geomCounty.attr('fill', geomCounty.color);
                        geomCounty.animate({
                            fill: geomCounty.color, 
                            stroke: "#ccc"
                        }, 200); // Reduced from 500 so fade is done when clicked, else remains other color.
                    }
                    $('#countyText').html($(this).find('.countyInfo').text());
                    $('#countyDetails').html($(this).find('.countyDetails').html());
                },
                mouseleave: function (e) {
                    if (istouch) return;
                    var county = this.id.substr(4);
                    //alert('leave ' + county);
                    var geomCounty = geom[county];

                    if (geomCounty && ! ~$.inArray(county, selectedCountiesNames)) {
                        geomCounty.animate({
                            fill: "#fffafa", 
                            stroke: "#99a"
                        }, 500);
                    }
                    $('#countyText').html('Georgia Counties');
                }

            }
            );

            //alert('test');

            if (istouch) {
                alert('istouch');
                // ADD SCROLL TO DIV FOR IPAD
                var myScroll;
                function loaded() {

                    setTimeout(function () {
                        myScroll = new iScroll('countyListWrapper', {
                            hideScrollbar: false
                        });
                    }, 100);
                }
                window.addEventListener('load', loaded, false);
            }
        //});

        // END FROM BELOW
        if (initialRequest == true) {
            initialRequest = false;
        }
        // Apply values after postback
        var arr = checkedCountyIDs.split(',');
        if (arr[0] != '') {
            $('#countyList input.countySet').each(function (i, c) { // All counties
                $.each(arr, function (ii, countyid) { // CountyIDs passed in
                    if (c.value == countyid) {
                        selectedCounties.push(c.value);
                        $('[name=countySet][value="' + countyid + '"]').prop('checked', true);
                    }
                });

            });
        }
        countiesAlphabetically(); // For initial load
        if (currentTab == 'locationTab') {
            zipTabSelected();
        }
        else if (currentTab == 'countyTab') {
            goCountiesLocTab(); // Used by location/search.aspx
        }
    });
}
